import styled from 'styled-components';


const Input = styled.input`
background: transparent;    
border: 1px solid #FFF;
color: #fff;    
    
    padding: 10px 140px;
    border-radius: 20px;
    width: 200px;
    font-size: 20px;
    margin-bottom: 10px;


    &::placeholder {
            color: #FFF;
            font-size: 16px;
    }
`;

export default Input;
